import {Avatar} from "antd";
import {AvatarProps} from "antd";
import styled from 'styled-components';

const CustomAvatar: React.FC<AvatarProps> = styled(Avatar)
    `
    shape: square;
    size: large;
    margin-top: 16px;
    margin-right: 16px;
`
;

export default CustomAvatar;
